[{"location":"","page":"Home","title":"Home","text":"CurrentModule = NBT","category":"page"},{"location":"#NBT","page":"Home","title":"NBT","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for NBT.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [NBT]","category":"page"},{"location":"#NBT.Tag","page":"Home","title":"NBT.Tag","text":"struct Tag{T}\n\nRepresents an NBT tag, containing an id, a name, and data.\n\nThe following are all values of T, ordered by id, starting from 0x1, and their corresponding names on the wiki:\n\n[UInt8, Int16, Int32, Int64, Float32, Float64, UInt8[],    String, Tag[], Tag[],    Int32[],   Int64[]   ]\n\n[Byte,  Short, Int,   Long,  Float,   Double,  Byte_Array, String, List,  Compound, Int_Array, Long_Array]\n\nProperties\n\nid::UInt8: The id of the tag. See minecraft wiki.\nname::String: The name of the tag.\ndata::T: The data in the tag. Its type is dictated by id. Do not use the wrong id-T combination or everything will break!\n\n\n\n\n\n","category":"type"},{"location":"#NBT.get_tags-Tuple{Tag, Integer}","page":"Home","title":"NBT.get_tags","text":"get_tags(tag, id::Integer; depth=10)\n\nReturns a Vector{Tag} containing all Tags in tag with id id, with an optional search depth limit.\n\nFor convenience, getindex is implemented, and only gets the first match on depth 1:\n\njulia> tag = Tag(0xa, \"\", [\n         Tag(0x3, \"test_int\", Int32(5)),\n         Tag(0x4, \"test_long\", Int64(5)),\n         Tag(0x3, \"test_int_2\", Int32(5))\n       ])\n(10) Tag[] (unnamed):\n▏ (3) Int32 test_int: 5\n▏ (4) Int64 test_long: 5\n▏ (3) Int32 test_int_2: 5\n\njulia> tag[4]\n(4) Int64 test_long: 5\n\njulia> tag[3]\n(3) Int32 test_int: 5\n\njulia> tag[3] === get_tags(tag, 3; depth=1)[1]\ntrue\n\nSee also get_tags\n\n\n\n\n\n","category":"method"},{"location":"#NBT.get_tags-Tuple{Tag, String}","page":"Home","title":"NBT.get_tags","text":"get_tags(tag, name::String; depth=10)\n\nReturns a Vector{Tag} containing all Tags in tag named name, with an optional search depth limit.\n\nFor convenience, getindex is implemented, and only gets the first match on depth 1:\n\njulia> tag = Tag(0xa, \"\", [\n         Tag(0x3, \"test_int\", Int32(5)),\n         Tag(0x4, \"test_long\", Int64(5)),\n         Tag(0x3, \"test_int_2\", Int32(5))\n       ])\n(10) Tag[] (unnamed):\n▏ (3) Int32 test_int: 5\n▏ (4) Int64 test_long: 5\n▏ (3) Int32 test_int_2: 5\n\njulia> tag[\"test_int\"]\n(3) Int32 test_int: 5\n\njulia> tag[\"test_int\"] === get_tags(tag, \"test_int\"; depth=1)[1]\ntrue\n\nSee also get_tags\n\n\n\n\n\n","category":"method"},{"location":"#NBT.read_nbt_uncompressed-Tuple{IO, Type{Tag}}","page":"Home","title":"NBT.read_nbt_uncompressed","text":"read_nbt_uncompressed(io, ::Type{Tag})\n\nReads an nbt tag from an uncompressed IO. Not exported.\n\n\n\n\n\n","category":"method"},{"location":"#NBT.set_tags-Tuple{Tag, Integer, Tag}","page":"Home","title":"NBT.set_tags","text":"set_tags(tag, id::Integer, newtag; depth=10)\n\nSets all Tags in tag with id id to newtag, with an optional search depth limit.\n\nFor convenience, setindex! is implemented, and only sets the first match on depth 1:\n\njulia> tag = Tag(0xa, \"\", [\n         Tag(0x3, \"test_int\", Int32(5)),\n         Tag(0x4, \"test_long\", Int64(5)),\n         Tag(0x3, \"test_int_2\", Int32(5))\n       ])\n(10) Tag[] (unnamed):\n▏ (3) Int32 test_int: 5\n▏ (4) Int64 test_long: 5\n▏ (3) Int32 test_int_2: 5\n\njulia> tag[4] = Tag(0x4, \"test_long\", 69420)\n(4) Int64 test_long: 69420\n\nSee also get_tags\n\n\n\n\n\n","category":"method"},{"location":"#NBT.set_tags-Tuple{Tag, String, Tag}","page":"Home","title":"NBT.set_tags","text":"set_tags(tag, name::String, newtag; depth=10)\n\nSets all Tags in tag named name to newtag, with an optional search depth limit.\n\nFor convenience, setindex! is implemented, and only sets the first match on depth 1:\n\njulia> tag = Tag(0xa, \"\", [\n         Tag(0x3, \"test_int\", Int32(5)),\n         Tag(0x4, \"test_long\", Int64(5)),\n         Tag(0x3, \"test_int_2\", Int32(5))\n       ])\n(10) Tag[] (unnamed):\n▏ (3) Int32 test_int: 5\n▏ (4) Int64 test_long: 5\n▏ (3) Int32 test_int_2: 5\n\njulia> tag[\"test_long\"] = Tag(0x4, \"test_long\", 69420)\n(4) Int64 test_long: 69420\n\nSee also get_tags\n\n\n\n\n\n","category":"method"},{"location":"#NBT.write_nbt_uncompressed-Tuple{IO, Tag}","page":"Home","title":"NBT.write_nbt_uncompressed","text":"write_nbt_uncompressed(io, tag)\n\nWrites an nbt tag to an uncompressed IO. Not exported.\n\n\n\n\n\n","category":"method"}]
